import React, { useEffect, useRef, memo, FC } from 'react';

import styles from './Main.module.css';
import togetherImg from "../assets/images/together.png";
import cssIcon from "../assets/stackIcons/css.png";
import jsIcon from "../assets/stackIcons/js.png";
import htmlIcon from "../assets/stackIcons/HTML5.png";
import cIcon from "../assets/stackIcons/C.png";
import cppIcon from "../assets/stackIcons/cpp.png";
import csIcon from "../assets/stackIcons/Csharp.png";
import dartIcon from "../assets/stackIcons/dart.png";
import flutterIcon from "../assets/stackIcons/Flutter.png";
import githubIcon from "../assets/stackIcons/github.png";
import javaIcon from "../assets/stackIcons/java.svg";
import pyIcon from "../assets/stackIcons/python.png";
import reactIcon from "../assets/stackIcons/React.png";
import tsIcon from "../assets/stackIcons/.png";
import unityIcon from "../assets/stackIcons/Unity.png";
import blenderIcon from "../assets/stackIcons/blender.png";


type Props = {
  canvasWidth: number; //canvas幅
  canvasHeight: number; //canvas高さ
  x: number; //矩形始点x
  y: number; //矩形始点y
  rectWidth: number; //矩形幅
  rectHeight: number; //矩形高さ
};


const Main: React.FC = () => {
  return (
    <main>
      <section className={styles.titleSection}>
      <h1>Piyoppi</h1>
      <p>Portfolio</p>
        <img
          src={togetherImg}
          alt="背景画像"
          className={styles.backgroundImage}
        />
      </section>

      <section className={styles.aboutSection}>
        <h2>About</h2>
        <div className={styles.textContainer}>
          <div className={styles.description}>
            愛知工業大学３年生
          </div>
        </div>
      </section>

      <section className={styles.stackSection}>
        <h2>Tech Stack</h2>
        <div className={styles.textContainer}>
          <div className={styles.description}>
            <a>
              <img src={htmlIcon} alt="htmlIcon" className={styles.icon} />
              <img src={cssIcon} alt="cssIcon" className={styles.icon} />
              <img src={jsIcon} alt="jsIcon" className={styles.icon} />
              <img src={cIcon} alt="cIcon" className={styles.icon} />
              <img src={cppIcon} alt="cIcon" className={styles.icon} />
              <img src={csIcon} alt="cIcon" className={styles.icon} />
              <img src={dartIcon} alt="cIcon" className={styles.icon} />
              <img src={cIcon} alt="cIcon" className={styles.icon} />
            </a>
          </div>
        </div>
      </section>
    </main>
  );
}

export default Main;
